// Debug: What binary properties exist?
console.log('=== BINARY DEBUG ===');
console.log('$binary exists:', !!$binary);

if ($binary) {
  const keys = Object.keys($binary);
  console.log('Binary property keys:', keys);

  keys.forEach(key => {
    const prop = $binary[key];
    console.log(`Property "${key}":`);
    console.log(`  - Type: ${typeof prop}`);
    console.log(`  - Constructor: ${prop.constructor.name}`);
    if (prop.length) console.log(`  - Length: ${prop.length}`);
    if (prop.mimeType) console.log(`  - MIME: ${prop.mimeType}`);
    if (prop.fileName) console.log(`  - Filename: ${prop.fileName}`);
  });
}

return {
  json: {
    binary_exists: !!$binary,
    binary_keys: $binary ? Object.keys($binary) : [],
    debug_complete: true
  }
};
